import React from 'react';
import '../../styles//Surgery.css';
import backgroundImage from '../../assets/SurgeryPage/back.png';
import { FaPhone } from 'react-icons/fa';

const SurgeryHeader = () => {
  return (
    <div className="surgery-header">
      <div className="surgery-background-wrapper">
        <img src={backgroundImage} alt="Surgery Background" className="surgery-background" />
        <div className="surgery-header-caption">
          <h1 className="surgery-title">AyuRaksha</h1>
          <h2 className="surgery-subtitle">
            End to end care from Top Surgeons<br /> at our Practo Care Clinics
          </h2>
          <p className="surgery-text">
            Talk to our care expert today to book your consultation.<br />
            All insurance accepted & No-cost EMI available.
          </p>
          <div className="contact-box">
            <FaPhone className="phone-icon" />
            <span>Reach out to us on&nbsp;|&nbsp;</span>
            <strong>08045685554</strong>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SurgeryHeader;
